import{_ as t,o as a,c as e,Q as s}from"./chunks/framework.adf0a5a1.js";const d=JSON.parse('{"title":"辛香汇","description":"","frontmatter":{"author":"Clo0oOoud"},"headers":[],"relativePath":"food/泉山区/辛香汇.md","filePath":"food/泉山区/辛香汇.md","lastUpdated":1696684299000}'),o={name:"food/泉山区/辛香汇.md"},l=s('<h1 id="辛香汇" tabindex="-1">辛香汇 <a class="header-anchor" href="#辛香汇" aria-label="Permalink to &quot;辛香汇&quot;">​</a></h1><h2 id="位置" tabindex="-1">🔍位置 <a class="header-anchor" href="#位置" aria-label="Permalink to &quot;:mag:位置&quot;">​</a></h2><img src="https://s2.loli.net/2023/09/22/8tyACZdKQ1LFP7s.png" alt="image-20230913233350915" style="zoom:50%;"><h2 id="🌰食评" tabindex="-1">🌰食评 <a class="header-anchor" href="#🌰食评" aria-label="Permalink to &quot;🌰食评&quot;">​</a></h2><p>虽然是连锁店，但是感觉每一家店的出品水平也不太一样。三胞广场那一家辛香汇还不错。</p><p>鸡丝凉面是必点的菜品了，钵钵鸡和蛋黄豆腐也不错，锦鲤奶酪第一次去可以尝尝，鸡爪煲的鸡爪炖的挺烂的，也很入味。感觉他们家的菜品没有什么踩雷的，口味都还不错，喜欢吃什么点来尝尝就行，价格上和店面环境也都还可以。</p><p>过生日的时候会送一碗切了“生日快乐”胡萝卜的素面哈哈哈（不如直接打个折来的实在）。</p><p><img src="https://s2.loli.net/2023/09/13/OKJYVgacSPsl5iw.png" alt="img"></p><p><img src="https://s2.loli.net/2023/09/13/XrWgaILYuFTsjAh.png" alt="img"><img src="https://s2.loli.net/2023/09/13/NRbSPlQ94YrMU7A.png" alt="img"><img src="https://s2.loli.net/2023/09/13/NRbSPlQ94YrMU7A.png" alt="img"><img src="https://s2.loli.net/2023/09/13/NRbSPlQ94YrMU7A.png" alt="img"><img src="https://s2.loli.net/2023/09/13/nkwAro8Z6tUQM5O.png" alt="img"><img src="https://s2.loli.net/2023/09/13/nkwAro8Z6tUQM5O.png" alt="img"></p><p><img src="https://s2.loli.net/2023/09/13/3CkHqBZ4AUF1ufX.png" alt="img"></p>',10),i=[l];function r(n,p,c,h,m,g){return a(),e("div",null,i)}const f=t(o,[["render",r]]);export{d as __pageData,f as default};
